function deleteStepsWithoutCaller(){swal({title:"Are you sure?",text:"Once deleted, you will not be able to recover this data!",icon:"warning",buttons:!0,dangerMode:!0}).then(e=>{e?(globalThis.selectedFlow.steps=globalThis?.selectedFlow?.steps.filter(t=>!globalThis.stepsWithoutCaller.find(e=>e.name==t.name)),deleteProcessEffect()):swal("Your data is safe!")})}function deleteDuplicatedSteps(){swal({title:"Are you sure?",text:"Once deleted, you will not be able to recover this data!",icon:"warning",buttons:!0,dangerMode:!0}).then(e=>{e?(e=globalThis.selectedFlow.steps.filter((t,e,l)=>e===l.findIndex(e=>e.name===t.name)),globalThis.selectedFlow.steps=e,deleteProcessEffect()):swal("Your data is safe!")})}function deleteProcessEffect(){try{closePopup(),loader.style.display="block",setTimeout(()=>{renderGraph(),loader.style.display="none",swal("Poof! Your data has been deleted!",{icon:"success"})},3e3)}catch(e){loader.style.display="none"}}